function shopping(input){

let budget = Number(input[0]);
let n = Number(input[1]);
let m = Number(input[2]);
let p = Number(input[3]);

let nprice = n * 250;
let mprice = nprice * 0.35 * m;
let pprice = nprice * 0.1 * p;
let total = nprice + mprice + pprice;

if(n > m ) {total = total * 0.85}

let diff = 0;

if(budget > total) {diff = Math.abs(total - budget);console.log(`You have ${(diff).toFixed(2)} leva left!`)}
else { diff = Math.abs(budget-total);console.log(`Not enough money! You need ${(diff).toFixed(2)} leva more!`)}



}

